        <Button onClick={() => handleChange('Hamster')}>Snake</Button>
        <Button onClick={() => handleChange('Mouse')}>Snake</Button>
        <Button onClick={() => handleChange('Pig')}>Snake</Button>
        <Button onClick={() => handleChange('Other')}>Snake</Button> */}
      </Grid>
    </Grid>
  );
}

export default connect(mapStoreToProps)(AdoptionTabs);
